import { NavLink,Navigate } from "react-router-dom";
import styles from "./styles.module.css";

const Navigation = () => {
	const navigate=Navigate();
	const handleLogout = () => {
        navigate("/");
    };
    return (
        <div className={styles.nav_links_container}>
<nav className={styles.navbar}>
				{/* Left Section with Logo */}
				<h1 className={styles.nav_logo}>WealthWise</h1>

				{/* Right Section with Navigation Links and Logout Button */}
				<div className={styles.nav_links_container}>
					<div className={styles.nav_links}>
						{/* Home Link */}
						<NavLink
							to="/DashBoard"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							DashBoard
						</NavLink>

						{/* Courses Link */}
						<NavLink
							to="/Income"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Income
						</NavLink>

						{/* Contact Link */}
						<NavLink
							to="/Expenses"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Expenses
						</NavLink>

						{/* About Link */}
						<NavLink
							to="/SavingInvestment"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Saving&Investment
						</NavLink>
					</div>

					{/* Logout Button */}
                    <div className="login-bar"><p className={styles.logoutBar}>|</p>
                    </div>
					<button className={styles.white_btn} onClick={handleLogout}>
                    Logout
					</button>
				</div>
			</nav>			
        </div>
    );
};

export default Navigation;
